import axios from 'axios';
import api from '../../../lib/axios';
class AdminTicketClerkService {

    async getAll() {
        const response = await axios.get('http://localhost:8080/api/ticket-clerk');
        return response.data;
    }

    async getById(id) {
        const response = await axios.get(`/ticket-clerks/${id}`);
        return response.data;
    }

    async create(ticketClerk) {
        const response = await axios.post('/ticket-clerks', ticketClerk);
        return response.data;
    }

    async update(id, updatedClerk) {
        const response = await axios.put(`/ticket-clerks/${id}`, updatedClerk);
        return response.data;
    }

    async delete(id) {
        const response = await axios.delete(`/ticket-clerks/${id}`);
        return response.data;
    }
}

export default new AdminTicketClerkService();
